import React from 'react'
import {useHistory} from 'react-router-dom'
import { Table,Button} from 'antd';

function BannerList() {
    const columns = [
        {
            width:300,
            title: '序号',
            key: 'name',
            render: (text,record,index) => <span>{index+1}</span>
        },
        {
            width:400,
            title: '轮播图',
            dataIndex: 'bannerimg',
            key: 'age',
            render:(text,record,index)=>(<img src={text} alt="" width="60px" height='60px' />)
        },
        {
            title: '链接地址',
            dataIndex: 'link',
            key: 'address',
        }
    ]

    const data = [
        {
            key: '1',
            bannerimg: 'https://ss3.bdstatic.com/70cFv8Sh_Q1YnxGkpoWK1HF6hhy/it/u=3511544063,4112539952&fm=26&gp=0.jpg',
            link: '32',
           
        },
        {
            key: '2',
            bannerimg: 'data:image/jpeg;base64,',
            link: '32',
        },
        {
            key: '3',
            bannerimg: 'https://ss0.bdstatic.com/70cFuHSh_Q1YnxGkpoWK1HF6hhy/it/u=1479437882,1763879786&fm=26&gp=0.jpg',
            link: '32',
        },
    ];
    const history = useHistory();
    const clickHandler = ()=>{
       history.push('/bannermanager/addimg')
        
    }
    return (
        <>
            <Button 
            type="primary"
            onClick={clickHandler}
            >添加轮播图</Button>
            <Table columns={columns} dataSource={data} />
        </>
        
    )
}

export default BannerList
